-- ----------------------------
--  Table structure for `persona`
-- ----------------------------
DROP TABLE IF EXISTS `persona`;
CREATE TABLE `persona` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `name` varchar(100) CHARACTER SET utf8 COLLATE utf8_spanish2_ci DEFAULT NULL,
  `dni` varchar(8) CHARACTER SET utf8 COLLATE utf8_spanish2_ci DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=8 DEFAULT CHARSET=utf8 COLLATE=utf8_spanish_ci;

-- ----------------------------
--  Table structure for `ubigeo`
-- ----------------------------
DROP TABLE IF EXISTS `ubigeo`;
CREATE TABLE `ubigeo` (
  `codubigeo` varchar(6) COLLATE utf8_spanish_ci NOT NULL,
  `lugar` varchar(100) COLLATE utf8_spanish_ci NOT NULL,
  `longitud` varchar(50) COLLATE utf8_spanish_ci NOT NULL,
  `latitud` varchar(50) COLLATE utf8_spanish_ci NOT NULL,
  PRIMARY KEY (`codubigeo`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_spanish_ci;

-- ----------------------------
--  Procedure definition for `usp_del_persona_by_id`
-- ----------------------------
DROP PROCEDURE IF EXISTS `usp_del_persona_by_id`;
DELIMITER ;;
CREATE PROCEDURE `usp_del_persona_by_id`(id int(11))
BEGIN
	DELETE FROM persona
	WHERE  persona.id = id;
END
;;
DELIMITER ;

-- ----------------------------
--  Procedure definition for `usp_get_persona`
-- ----------------------------
DROP PROCEDURE IF EXISTS `usp_get_persona`;
DELIMITER ;;
CREATE PROCEDURE `usp_get_persona`()
BEGIN
SELECT
	persona.id,
	persona.name,
	persona.dni
FROM persona;
END
;;
DELIMITER ;

-- ----------------------------
--  Procedure definition for `usp_get_persona_by_id`
-- ----------------------------
DROP PROCEDURE IF EXISTS `usp_get_persona_by_id`;
DELIMITER ;;
CREATE PROCEDURE `usp_get_persona_by_id`(id int(11))
BEGIN
SELECT
	persona.id,
	persona.name,
	persona.dni
FROM persona
WHERE  persona.id = id;
END
;;
DELIMITER ;

-- ----------------------------
--  Procedure definition for `usp_get_ubigeo_departamento`
-- ----------------------------
DROP PROCEDURE IF EXISTS `usp_get_ubigeo_departamento`;
DELIMITER ;;
CREATE PROCEDURE `usp_get_ubigeo_departamento`()
BEGIN
	#Routine body goes here...
	SELECT LEFT(ubigeo.codubigeo,2) AS codubigeo, ubigeo.lugar
	FROM ubigeo
	WHERE RIGHT(ubigeo.codubigeo, 4) = "0000"
	ORDER BY ubigeo.codubigeo ASC
;
	-- usp_get_ubigeo_departamento
END
;;
DELIMITER ;

-- ----------------------------
--  Procedure definition for `usp_get_ubigeo_distrito_by_codubigeo`
-- ----------------------------
DROP PROCEDURE IF EXISTS `usp_get_ubigeo_distrito_by_codubigeo`;
DELIMITER ;;
CREATE PROCEDURE `usp_get_ubigeo_distrito_by_codubigeo`(codubigeo varchar(4))
BEGIN
	#Routine body goes here...
	SELECT ubigeo.codubigeo, ubigeo.lugar
	FROM ubigeo
	WHERE LEFT(ubigeo.codubigeo, 4) = LEFT(codubigeo, 4)
	AND RIGHT(ubigeo.codubigeo, 2) <> "00"
	;
/*
	010000 - departamento 01
	010100 - provincia 01
	010200 - provincia 02
	010201 - distrito 01
	010202 - distrito 02
*/

	-- usp_get_ubigeo_distrito_by_codubigeo
END
;;
DELIMITER ;

-- ----------------------------
--  Procedure definition for `usp_get_ubigeo_provincia_by_codubigeo`
-- ----------------------------
DROP PROCEDURE IF EXISTS `usp_get_ubigeo_provincia_by_codubigeo`;
DELIMITER ;;
CREATE PROCEDURE `usp_get_ubigeo_provincia_by_codubigeo`(codubigeo varchar(2))
BEGIN
	#Routine body goes here...
	SELECT LEFT(ubigeo.codubigeo,4) AS codubigeo, ubigeo.lugar
	FROM ubigeo
	WHERE LEFT(ubigeo.codubigeo, 2) LIKE LEFT(codubigeo, 2)
	AND RIGHT(ubigeo.codubigeo, 2) LIKE "00"
	AND RIGHT(ubigeo.codubigeo, 4) <> "0000"
	;
/*
	010000 - departamento 01
	010100 - provincia 01
	010200 - provincia 02
*/

	-- usp_get_ubigeo_provincia_by_codubigeo
END
;;
DELIMITER ;

-- ----------------------------
--  Procedure definition for `usp_set_persona`
-- ----------------------------
DROP PROCEDURE IF EXISTS `usp_set_persona`;
DELIMITER ;;
CREATE PROCEDURE `usp_set_persona`(name varchar(100),dni varchar(8))
BEGIN
INSERT INTO  persona(
	persona.name,
	persona.dni
)
VALUES(
	name,
	dni
);
END
;;
DELIMITER ;

-- ----------------------------
--  Procedure definition for `usp_upd_persona`
-- ----------------------------
DROP PROCEDURE IF EXISTS `usp_upd_persona`;
DELIMITER ;;
CREATE PROCEDURE `usp_upd_persona`( id int(11),name varchar(100),dni varchar(8) )
BEGIN
UPDATE persona SET
	persona.name = name,
	persona.dni = dni
WHERE persona.id = id;
END
;;
DELIMITER ;

